import React from 'react';
import './DiseaseResult.css';

const DiseaseResult = ({ diseaseName }) => {
  const handleDoctorSearch = () => {
    // You can add the functionality for doctor search here (like routing to another page)
    alert("Redirecting to Doctor Search...");
  };

  return (
    <div className="disease-result-container">
      <h2 className="result-title">Disease Prediction Result</h2>
      <div className="result-content">
        <p className="result-text">
          Based on the analysis, the patient is diagnosed with <strong>{diseaseName}</strong>.
        </p>
      </div>
      <button className="doctor-search-btn" onClick={handleDoctorSearch}>
        Search Doctors
      </button>
    </div>
  );
};

export default DiseaseResult;
